import './App.css';
import logo from '../../logo.svg';
import Header from "../Header/Header";
import AppContent from "../Body/AppContent";
import Footer from "../Footer/Footer";
function App(){
    return (
        <div>
            <Header pageTiltle="Quizzi" logoSrc ={logo} />
            <div className="container-fluid">
                <div className="row">
                    <div className="col">
                        <AppContent />
                    </div>
                </div>
            </div>
            <Footer pageTiltle="Quizzi"/>
        </div>
    )
}

export default App;
